import { All_Stories } from "../comps/Portal";

const Stories = () => {
  return (
    <div className="pagecenter-x pb-40">
      <h1 className="title">Customer Stories</h1>
      <All_Stories />
      <section className="bg-slate-100 w-full min-h-[45vh] text-center"></section>
    </div>
  );
};

export default Stories;
